import React from "react";

const LandingPage = () => {
  return (
    <div className="bg-gradient-to-b from-yellow-50 from-40% via-amber-50 to-yellow-100 h-screen flex items-center justify-center p-6">
      <div className="text-center max-w-4xl">
        <h1 className="text-7xl md:text-8xl font-extrabold bg-gradient-to-r from-amber-200 via-yellow-400 to-amber-300 bg-clip-text text-transparent drop-shadow-sm mb-6">
          AI-Powered Streak Counter
        </h1>
        <p className="text-xl from-yellow-50 from-40% via-amber-50 to-yellow-100 bg-clip- font-semibold max-w-2xl mx-auto">
          Click to streak. Get inspired. Stay healthy. See your progress.
        </p>
      </div>
    </div>
  );
};

export default LandingPage;
